import React from 'react';

const PlayerControls = (props) => {
	return(
		<div>
			<div className="progress-bar">
				<div className="filler" style= {{ width: `${props.percentage}%` }}>

				</div>
			</div>
		</div>
		);
};

export default PlayerControls
